// SPDX-License-Identifier: SimPL-2.0

pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;

import "../token/Fighter.sol";
import "../authority/Member.sol";
import "../libraries/NftLibrary.sol";

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";

/**
 * @title Fighter Z Token Card Shop
 *
 * @author Bit Lighthouse. Ace
 * AT: 2021-3-28 | VERSION: v1.0.2
 */

contract CardShop is Member {
    using SafeMath for uint256;
    using EnumerableSet for EnumerableSet.UintSet;

    ConfStruct public _conf;
    mapping (address => uint256) public _amounts;
    mapping (uint8 => NftLibrary.CardStruct) private _cards;

    struct ConfStruct { uint8 quality; uint32 total; }
    event Buy(uint8 quality, uint16 heroId, uint256 tokenId, uint16 rate);

    constructor(address auth_) Member(auth_) {
        _cards[1] = NftLibrary.CardStruct({
            start: 2000, plus: 0, role: _create(7, 1)
        });

        _cards[2] = NftLibrary.CardStruct({
            start: 200, plus: 800, role: _create(5, 5)
        });

        _cards[3] = NftLibrary.CardStruct({
            start: 90, plus: 410, role: _create(20, 50)
        });

        _cards[4] = NftLibrary.CardStruct({
            start: 50, plus: 150, role: _create(20, 100)
        });

        _cards[5] = NftLibrary.CardStruct({
            start: 50, plus: 150, role: _create(20, 348)
        });

        _cards[5].role[19] = _cards[5].role[19] + 8;

        _conf = ConfStruct({quality: 5, total: 10000});
    }

    function _create(uint8 len_, uint32 number_) private pure
        returns (uint32[] memory roles){

        roles = new uint32[](len_);
        for (uint8 i = 0; i < len_; i++) roles[i] = number_;
    }

    function _choose() private view returns (uint8 q, uint8 h, uint16 r) {
        uint32  index = 0; bool is_break = false;
        uint256 ran = NftLibrary.random(_conf.total);

        for (uint8 i = 1; i < _conf.quality + 1; i++) {
            if (is_break) break;

            NftLibrary.CardStruct memory cs = _cards[i];
            for (uint8 j = 0; j < cs.role.length; j++) {
                if (ran > index && ran <= cs.role[j] + index) {
                    q = i; h = (j + 1); is_break = true;
                    uint256 total = _cards[i].plus + _cards[i].start;
                    r = uint16(NftLibrary.random(total));

                    if (r > _cards[i].plus) r = r - _cards[i].start;
                    if (r < _cards[i].start) r = r + _cards[i].start;

                    break;
                }

                index = index + cs.role[j];
            }
        }
    }

    function addCardQuality() public CheckPermit("CONFIG") {
        _conf.quality = _conf.quality + 1;
    }

    function setCardsByQuality(
        uint8 quality_, uint8 role_, uint32 supply_, uint16 start_, uint16 plus_
    ) public CheckPermit("CONFIG") {
        if (role_ > 0 && supply_ > 0) {
            _cards[quality_].role = _create(role_, supply_);
            _conf.total = _conf.total + (role_ * supply_);
        }

        if (start_ > 0 || plus_ > 0) {
            _cards[quality_].start = start_;
            _cards[quality_].plus = plus_;
        }
    }

    function setSaleAmount(string memory name_, uint256 amount_)
        public CheckPermit("CONFIG") {

        _amounts[authority.members(name_)] = amount_ * 1e18;
    }

    function fresh(uint8 quality_, uint16 role_) public
        CheckPermit("CARDREWARD") {

        uint32 surpls = _cards[quality_].role[role_];
        _cards[quality_].role[role_] = surpls + 1;
    }

    function buy(string memory symbol_) public CheckStatus("BUY") {
        require(
            !authority.authorities(address(0), "OPEN"),
            "CARDSHOP: Shop is not open."
        );

        address token = authority.members(symbol_);
        address recipient = authority.members("RECIPIENT");

        bool success = IERC20(token).transferFrom(
            msg.sender, recipient, _amounts[token]
        );

        require(success, "CARDSHOP: Transaction failed");

        NftLibrary.DetailStruct memory ds;
        ds.amount = _amounts[token];
        (ds.quality, ds.heroId, ds.rate) = _choose();

        uint112 tokenId = NftLibrary.generate(ds);
        uint32 surpls = _cards[ds.quality].role[ds.heroId];
        _conf.total = _conf.total - 1;
        _cards[ds.quality].role[ds.heroId] = surpls - 1;

        address nft = authority.members("FIGHTER");
        Fighter(nft).buy(msg.sender, tokenId);

        emit Buy(ds.quality, ds.heroId, tokenId, ds.rate);
    }
}

